%[text] # Multi-dimensional images
%[text] Epifluourescence image dimensions contain multitudes. They can range in the number of channels, z-planes, and even time dimensions. Dimensions are organized as follows: XYCZT, where the first two dimensions are the rows and columns, and the remaining dimensions are dedicated to Color, Volume, and Time. 
%[text] In this live script, we open proprietary microscope images with a range of channels and numbers of z-planes. 
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] ## Proprietary Microscope Formats
%[text] Major microscope manufacturers have developed proprietary file formats for their respective imaging systems. For instance, Zeiss microscopes save images with a `.CZI` extension, while Nikon uses the `.ND2`format. These proprietary formats are typically the most complete, making them the recommended choice for saving your work. Although each format is unique to its manufacturer, they all essentially store the same type of data: a matrix of numbers accompanied by metadata that describes how the data was acquired. The real challenge arises when trying to open these formats in software other than what the manufacturers provide. This is where the Bio-Formats team comes in—they’ve created a toolbox that enables access to nearly all major proprietary file types. You may have noticed that Fiji uses the Bio-Formats plugin to open some of the files I previously shared with you. In this exercise, we’ll use the MATLAB toolbox developed by the Bio-Formats team called [`bfmatlab`](https://www.openmicroscopy.org/bio-formats/downloads/). I’ve added the latest version of this toolbox to the MtMtools folder. To streamline the process of opening proprietary file formats in MATLAB, I’ve also written a function called `mmReadImgND`, which utilizes this the `bfmatlab` toolbox to read the image data.
%[text] Add the `bfmatlab` toolbox to your file path. Be sure to save the file path so you can use the toolbox going forward. 
%[text] ![](text:image:5999)![](text:image:33e8)
%%
%[text] ## Two Channel, 1 Plane Example: Mouse Retina
%[text] For this section, we will load the mouse\_retina\_C4L.0(-1)\_PTAU.nd2 — a Nikon format
%[text] %[text:anchor:H_332E8260] ### Load the data
%[text] We use **mmReadImgND** to load the file as follows. 
%[text] - We use mmSetUnitDataFolder to change the current folder to the data folder in Unit 1
%[text] - We set the filename to "mouse\_retina\_C4L.0(-1)\_PTAU.nd2"
%[text] - We read the volume using **mmReadImgND** \
clearvars
clc
mmSetUnitDataFolder(2) %[output:0b7e984f]
filename = "mouse_retina_C4L.0(-1)_PTAU.nd2" %[output:7e679dfd]
[p.img,p.meta] = mmReadImgND(filename);
%%
%[text] %[text:anchor:H_7E14ABBA] #### Review the metadata
p.meta
%[text] - what is the bit depth of the image? **12-bit**
%[text] - what is the dimension of a pixel  in µm (PixelSpacing): **\[0.273 X 0.273\]**
%[text] - How many channels are there? **2** \
%%
%[text] %[text:anchor:H_352649F4] #### Review the image variable, p.*img*
%[text] 

%[text] - How many channels?
%[text] - How many z-planes? \
%%
%[text] - What is the maximum pixel intensity found in *img?*  \

%[text] 
%%
%[text] %[text:anchor:H_932E311E] ### Normalize the data
%[text] Normalize the data so that it ranges from 0 to 1 using `mat2gray. Notice that we normalize each channel separately — that's better practice since the dynamic range on each channel may be different.`
p.imgn = zeros(size(p.img),'single');
p.imgn(:,:,1) = mat2gray(p.img(:,:,1)); % normalize channel 1
p.imgn(:,:,2) = mat2gray(p.img(:,:,2)); % normalize channel 2
%%
%[text] %[text:anchor:H_5D910A17] ### Display Image
%[text] - What happens if we try to display the image using **imshow** \
close all
figure
imshow(p.img)
%[text] - `imshow` can't handle it because it only has 2 channels \
%%
%[text] %[text:anchor:H_C0F616DE] ### Display the channels separately
%[text] Display channels 1 and 2, side by side
figure;
tiledlayout(1,2,"TileSpacing","none")

nexttile
imshow(p.imgn(:,:,1))
title('Channel 1')

nexttile
imshow(p.imgn(:,:,2))
title('Channel 2')
%[text] - its more accurate to label the channels by their number (instead of the red channel or the green channel).  \
%%
%[text] %[text:anchor:H_E40F0717] ### Channels and Histograms
%[text] **mmShowHist** can handle 2-channel images 
figure
mmShowHist(p.imgn)
%[text] - Are the any saturated pixels? Which Channel? \
%%
%[text] %[text:anchor:H_F15F4639] ### Fun with imshowpair
%[text] We can use imshowpair to display two-channel images. With this syntax, we are saying "Put Channel 2 in the Green position, and Channel 1 in the Blue position." — that better matches how the images were captured. 
figure
imshowpair(p.imgn(:,:,1),p.imgn(:,:,2),ColorChannels=[0 2 1]) % 
%[text] - Rememer, the default for `imshowpair` is magenta-green \
%%
%[text] We can get fancy with the inputs and change the channel colors by name
imshowpair(p.imgn(:,:,1),p.imgn(:,:,2),"ColorChannels",'red-cyan')
%%
%[text] **you try**: 
%[text] - swap red and blue
%[text] - Show green and magenta \
imshowpair(p.imgn(:,:,1),p.imgn(:,:,2),"ColorChannels",[1 2 1])
%%
%[text] ## 3 Channel Example: Bulb
%[text] ### Load image
%[text] In this example, we open a .jp2 file, which happens to also be a Nikon format.
close all
clearvars
clc
mmSetUnitDataFolder(2);
filename = "PLP PD2_2 4E 4x.jp2"
[p.img,p.meta] = mmReadImgND(filename);
%%
%[text] - How many channels?
%[text] - how many z-slices?
%[text] - Bit depth? \
p.meta
%%
%[text] %[text:anchor:H_BF32DE4F] ### Display channels
figure;
mmShowHist(p.img)
%[text] - looks like a bit-depth mismatch \
%[text] 
%%
%[text] %[text:anchor:H_DDF59795] ### Normalize each channel and display
p.imgn = zeros(size(p.img),'single');
for n=1:3
    p.imgn(:,:,n) = mat2gray(p.img(:,:,n));
end

clf
imshow(p.imgn)
%[text] - Since there are 3 channels, we can use `imshow`.
%[text] - now we can see things more clearly
%[text] - Is this a fluorescent image? \
%%
%[text] #### Display the histogram for each channel
mmShowHist(p.imgn)
%%
%[text] ## A 5 Color, Multi-slice Example: Taste bud
%[text] No law says that you can only capture three color channels. In the following image stack, 5 color channels were captured on a Leika Confocal Microscope (LIF file)
%[text] ### **Load the stack** 
%[text] In the unit data folder, there is a file called "confetti\_mice.lif". A \*.lif file is a proprietary file format specific to Leica Confocal Microscopes.
%[text] We will open this file using **imreadND**. If you don't input a file path, you will be prompted for one: 
%[text] - Choose the confetti\_mice.lif file when prompted.
%[text] - Select Series 0. \
clearvars;
close all
mmSetUnitDataFolder(2)
[RGB4D, meta] = mmReadImgND("confetti_mice.lif");
%%
%[text] %[text:anchor:H_7501] Review the metadata
meta
%[text] - How many Channels?
%[text] - How many Slices?
%[text] - Bit depth? \
%%
%[text] What are the dimensions of RGB4D?
size(RGB4D)
%[text] - RGB4D has 4 dimensions
%[text] - There are 5 color channels and 14 z-slices
%[text] - How many total images are in this stack? \
%%
%[text] %[text:anchor:H_4F29AC53] ### Display the extended metadata
disp(meta.XML)
%[text] - PMT: photomultiplier
%[text] - Lasers!
%[text] - Immersion = Oil \
%%
%[text] ### Indexing out a Channel
%[text] Get the channel 1 stack
ch1.vol = RGB4D(:,:,1,:);
size(ch1.vol)
%[text] - notice when we index out a channel, we still get a 4D array \
%%
%[text] #### Squeeze your channels
%[text] Its often easier to deal with 3D volumes for each channel. Luckily, we we can easily convert the 4D to a 3D volume, using the function **squeeze,** which drops any singleton dimensions.
ch1.vol = squeeze(ch1.vol)
size(ch1.vol)
%[text] - and now we have a 3D volume \
%%
%[text] Since it is a 3D volume, we can plug our volume into **montage**
figure
montage(ch1.vol)
colormap("turbo")
%%
%[text] ### Displaying the channels in a five channel image?
%[text] #### Projections
%[text] %[text:anchor:H_2C879E60] One way to visualize the image dataset is to display the volumes as projections.
%[text] We have 5 channels and 14 slices. To create projection images for each channel, we need to index out each channel and then get the max of all 14 slices from that channel Recall, the function **squeeze** reduces Dimensionality. Specifically, it eliminates any dimensions with a size of one. So, for each channel, the steps are as follows:
%[text] 1. Index out a channel
%[text] 2. Squeeze that channel so it only has three dimensions
%[text] 3. Get the max of the 3D volume
%[text] 4. Display the projection \
%[text] These steps are easily tackled using our old friend, the FOR LOOP. 
figure;
tiledlayout("horizontal","TileSpacing","none","Padding","compact");

for n=1:size(RGB4D,3)
    IMG3D = squeeze(RGB4D(:,:,n,:)); % index out a 3D stack from the 4D stack
    IMG3D = single(mat2gray(IMG3D)); % normalize for display purposes
    img_max = max(IMG3D,[],3); % create a max projection

    % display
    nexttile
    imshow(imadjust(img_max))
    title(sprintf('Ch %d',n))
end
%[text] - Et voila!
%[text] - Notice that there is a lot of noise in the second channel: the signal to noise ratio is very low in this channel \
%%
%[text] %[text:anchor:H_7E04F60E] ### A faster way to create a projection in a Multi-channel, multi-slice image
%[text] instead of the code above, we can create a max projection in one simple step, as follows:
proj = max(RGB4D,[],4);
size(proj)
%[text] - In this syntax, we create a max projection across the fourth dimension \
%%
%[text] %[text:anchor:H_6E2DACDC] ### **Channels and Histograms** 
%[text] mmShowHist can handle more than 3 channels. 
figure
mmShowHist(proj)
colormap("turbo")
%[text] - notice that the images look different here.
%[text] - This is because each channel was not normalized or adjusted. If you want images enhanced, you need to use a for loop, like above \
%%
%[text] %[text:anchor:H_E0246154] ### Display images using imshow
%[text] Remember, ***imshow*** can only handle 3 channels. You can display the first three channels as so:
figure;
rgb = proj(:,:,[1 2 4]);

imshow(rgb)
%[text] - TRY IT YOURSELF: Display the odd channels \
%%
%[text] The image is a little dim. We can enhance the contrast using rgb using **imadjust**
lowhigh = stretchlim(rgb);
rgb = imadjust(rgb,lowhigh,[]);
imshow(rgb)
%[text] 
%%
%[text] %[text:anchor:H_2BD184E8] ## Combining all the channels for display
%[text] %[text:anchor:H_14FD0196] To display all five channels at once, we need to combine the channels in some fashion. 
%[text] In this example, we will take the max across pairs of channels to create a new RGB image as follows
%[text] 1. Red = max of Ch1 + Ch4
%[text] 2. Green = max of Ch1 + Ch2 + Ch3
%[text] 3. Blue = max of Ch3 and 5 \
proj = mat2gray(proj);
rgb = proj;
rgb(:,:,[4 5]) = [];
rgb(:,:,1) = max(proj(:,:,[1 4]),[],3);
rgb(:,:,2) = max(proj(:,:,[1 2 3]),[],3);
rgb(:,:,3) = max(proj(:,:,[3 5]),[],3);
imshow(rgb)
%[text] - And that's how we display 5 different channels together in one RGB image \
%[text] %[text:anchor:H_0B3C17E4] ### 
%%
%[text] %[text:anchor:H_AC32B261] ## Segmentation
%[text] Since this is a fluorescent image, we can segment each channel separately. As usual, we will need to normalize, filter the volume, and then binarize. Most of our segmentation functions work easiest with 3D volumes, so we will also squeeze each volume. The steps are as follows:
ch1.voln = im2single(mat2gray(ch1.vol)); % normalize and typecast to singe (for memory purposes)
ch1.medf = medfilt3(ch1.voln);
ch1.mask = imbinarize(ch1.medf);
ch1.mask = bwareaopen(ch1.mask,50);

figure
montage(ch1.mask)
%%
%[text] %[text:anchor:H_4D12E2B1] ### Binarize all the Channels using a for loop
%[text] 
figure;
tiledlayout("flow","TileSpacing","compact","Padding","compact")

MASK4D = false(size(RGB4D)); % preallocation

for n=1:size(RGB4D,3)

    ch.vol = squeeze(RGB4D(:,:,n,:)); % index out a 3D stack from the 4D stack
    ch.voln = single(mat2gray(ch.vol)); % normalize for display purposes
    ch.medf = medfilt3(ch.voln); % apply median filter for noise
    ch.mask = imbinarize(ch.medf);
    ch.mask = bwareaopen(ch.mask,50);
    MASK4D(:,:,n,:) = ch.mask; % add back to the 4D mask

    % create a max projection for display
    img_max = max(ch.mask,[],3);

    % display
    nexttile
    imshow(img_max)
    title(sprintf('Channel %d',n))
end
%%
%[text] %[text:anchor:H_C845D532] ## Explore stacks
%[text] %[text:anchor:H_AF60C471] mmSliceView can handle multi-channel images
mmSliceView(RGB4D,MASK4D)
%[text] - enter the channels you want to overlay in the box next to the spinner \
%%
volshow(ch.mask)
%%
